    "page" arguments to decide the users to display.

    Paging can be implemented by using the skip() and limit() cursor methods.
    */

    // Use the cursor to only return the users that belong on the current page
    const displayCursor = cursor.limit(usersPerPage)

    try {
      const usersList = await displayCursor.toArray()
      const totalNumUsers = page === 0 ? await users.countDocuments(query) : 0

      return { usersList, totalNumUsers }
    } catch (e) {
      console.error(
        `Unable to convert cursor to array or problem counting documents, ${e}`,
      )
      return { usersList: [], totalNumUsers: 0 }
    }
  }

  static async getNestedDocsByID(ids) {
    let cursor
    try {
      const pipeline_ = [
        { "$match": { 'external_id_str': {$in: ids}}},
        {
          $lookup: {
            from: "clubs",
            let: { clubName: "$club" },
            pipeline: [
              {
                $match: {
                  $expr: { 
                    $and: [
                      { $eq: ["$Club", "$$clubName"] },
                     ],
                  },
                },
              },
            ],
            as: "club_country",
          },
        },
        {
          $unwind: "$club_country",
        },
        {$project : { _id : 0, external_id_str : 1, name : 1, club : 1, 
          country : "$club_country.Country",
          total : "$club_country.Total"}}
      ]
      cursor = await users.aggregate(pipeline_)
      return cursor.toArray()
    } catch (e) {
      /**
      Ticket: Error Handling

      Handle the error that occurs when an invalid ID is passed to this method.
      When this specific error is thrown, the method should return `null`.
      */

      // TODO Ticket: Error Handling
      // Catch the InvalidId error by string matching, and then handle it.
      console.error(`Something went wrong in getUserByID: ${e}`)
      throw e
    }
  }

  static async getUsersByIds(ids) {
    /**
    Ticket: Projection

    Write a query that matches users with the ids in the "ids"
    list, but only returns user_id, name, club of each user.

    Remember that in MongoDB, the $in operator can be used with a list to
    match one or more values of a specific field.
    */
    let cursor
    try {
      // TODO Ticket: Projection
      // Find users matching the "ids" list
      // Do not put a limit in your own implementation, the limit
      // here is only included to avoid sending 46000 documents down the
      // wire.
      cursor = await users.find({'external_id_str': {$in: ids}},
      {projection: { _id: 0,external_id_str: 1, name: 1, club: 1 }})

    } catch (e) {
      console.error(`Unable to issue find command, ${e}`)
      return []
    }

    return cursor.toArray()
  }

static async getUserByID(id) {
    try {
      /**
      Ticket: Get Comments

      Given a user ID, build an Aggregation Pipeline to retrieve the comments
      matching that user's ID.

      The $match stage is already completed. You will need to add a $lookup
      stage that searches the `comments` collection for the correct comments.
      */

      // TODO Ticket: Get Comments
      // Implement the required pipeline.
      const pipeline = [
        {
          $match: {
            _id: ObjectId(id)
          }
        }
      ]
      return await users.aggregate(pipeline).next()
    } catch (e) {
      /**
      Ticket: Error Handling

      Handle the error that occurs when an invalid ID is passed to this method.
      When this specific error is thrown, the method should return `null`.
      */

      // TODO Ticket: Error Handling
      // Catch the InvalidId error by string matching, and then handle it.
      console.error(`Something went wrong in getUserByID: ${e}`)
      throw e
    }
  }
}

